@import '@/styles/shared.scss';

.wrapper {
  padding: 90px 0;
  overflow: hidden;
}

.motorcycleWrapper {
  display: grid;
  grid-template-columns: repeat(4, 1fr);
  gap: 50px;
}

.slider {
  display: none;
}

@media (max-width: 1080px) {
  .motorcycleWrapper {
    grid-template-columns: repeat(3, 1fr);
  }
}

@media (max-width: 800px) {
  .motorcycleWrapper {
    grid-template-columns: repeat(2, 1fr);
  }
}

@media (max-width: 639px) {
  .motorcycleWrapper {
    display: none;
  }

  .slider {
    display: block;
  }
}
